import React from "react";
import { TrackType } from "../types/Types";
import "../components/TrackList.css";

interface Props {
  data: TrackType;
  onUpdate: (id: number, track: TrackType) => void;
  onDelete: (id: number) => void;
}

const updatedTrack = {
    id: 8,
    title: "Update",
    artist: "Update",
    genre: "Update",
    bpm: 50,
}

const Track: React.FC<Props> = ({ data, onUpdate, onDelete }) => {
  var trackData = data;

  return (
    <tr key={trackData.id}>
      <td>{trackData.title}</td>
      <td>{trackData.artist}</td>
      <td>{trackData.genre}</td>
      <td>{trackData.bpm}</td>
      <td>
        <button className="button" onClick={() => onUpdate(trackData.id, updatedTrack)}>
          Update
        </button>
        <button className="button" onClick={() => onDelete(trackData.id)}>
          Delete
        </button>
      </td>
    </tr>
  );
};

export default Track;
